import React from "react";

function Parenthesis(props){
    const isClicked = props.boolean;
    return(

            <button onClick={() => {
                props.onChecked(props.id);
          }}
          className={isClicked ? "parenthesis": "parenthesis clickeParen"}> 
            {props.text}
            </button>
    );
}

export default Parenthesis;
